from tkinter import *
import base64

class Tela_Principal:

    def __init__(self) -> None:

        self.font_menu = 'Calibri 14 bold'
        self.font_titulo = 'Calibri 24 bold'

        self.color_theme = 'Black'
        self.color_contrast = 'White'

        self.height_window = 550

        #CARREGA AS IMAGENS PARA O SISTEMA
        self.setImagensBase64()

        self.frame_only = None

        self.window()
    
    def window(self):
        self.windowMain = Tk()
        self.windowMain.title("IGTEC - SERVICE SYSTEM")
        self.windowMain.resizable(False, False)
        
        #ABRIR MENU LATERAL
        self.menu()

        #ABRIR HOME
        self.home()

        self.windowMain.mainloop()

    def menu(self):
        
        #FRAME DO MENU
        self.frameMenu = Frame(self.windowMain, width=100, height=self.height_window, bg=self.color_theme)
        self.frameMenu.pack(side=LEFT)

        imagem_inicio = PhotoImage(data=base64.b64decode(self.imagem_inicio))
        self.btInicio = Button(self.frameMenu, text='Home', font=self.font_menu, image=imagem_inicio, width=96, height=80, compound=TOP, bd=0, bg=self.color_theme, fg=self.color_contrast, command=self.home)
        self.btInicio.imagem = imagem_inicio
        self.btInicio.place(x=0, y=0)

        imagem_unhas = PhotoImage(data=base64.b64decode(self.imagem_unhas))
        self.btUnhas = Button(self.frameMenu, text='Unhas', font=self.font_menu, image=imagem_unhas, width=96, height=80, compound=TOP, bd=0, bg=self.color_theme, fg=self.color_contrast, command=self.unhas)
        self.btUnhas.imagem = imagem_unhas
        self.btUnhas.place(x=0, y=90)
        
        imagem_sobrancelhas = PhotoImage(data=base64.b64decode(self.imagem_sobrancelhas))
        self.btSobrancelhas = Button(self.frameMenu, text='Olhos', font=self.font_menu, image=imagem_sobrancelhas, width=96, height=80, compound=TOP, bd=0, bg=self.color_theme, fg=self.color_contrast)
        self.btSobrancelhas.imagem = imagem_sobrancelhas
        self.btSobrancelhas.place(x=0, y=180)
        
        imagem_croche = PhotoImage(data=base64.b64decode(self.imagem_croche))
        self.btCroche = Button(self.frameMenu, text='Crochê', font=self.font_menu, image=imagem_croche, width=96, height=80, compound=TOP, bd=0, bg=self.color_theme, fg=self.color_contrast)
        self.btCroche.imagem = imagem_croche
        self.btCroche.place(x=0, y=270)

        imagem_calendario = PhotoImage(data=base64.b64decode(self.imagem_calendario))
        self.btCalendario = Button(self.frameMenu, text='Serviços', font=self.font_menu, image=imagem_calendario, width=96, height=80, compound=TOP, bd=0, bg=self.color_theme, fg=self.color_contrast)
        self.btCalendario.imagem = imagem_calendario
        self.btCalendario.place(x=0, y=360)

        imagem_config = PhotoImage(data=base64.b64decode(self.imagem_config))
        self.btConfig = Button(self.frameMenu, text='Ajustes', font=self.font_menu, image=imagem_config, width=96, height=80, compound=TOP, bd=0, bg=self.color_theme, fg=self.color_contrast, command=self.ajustes)
        self.btConfig.imagem = imagem_config
        self.btConfig.place(x=0, y=450)

    def home(self):
        
        #DESTROI O FRAME ATUAL
        self.destruirFrameOnly()

        #FRAME DE EXIBIÇÃO HOME
        self.frameHome = Frame(self.windowMain, width=750, height=self.height_window, bg=self.color_contrast)
        self.frameHome.pack(side=RIGHT)

        #LOGO
        logo = PhotoImage(data=base64.b64decode(self.imagem_logo))
        w = Label(self.frameHome, image=logo, bd=0)
        w.imagem = logo
        w.place(x=-5, y=-40)
        
        #ATRIBUI AO FRAME ATUAL
        self.frame_only = self.frameHome
    
    def unhas(self):
        #DESTROI O FRAME ATUAL
        self.destruirFrameOnly()

        #FRAME DE EXIBIÇÃO HOME
        self.frameSobrancelhas = Frame(self.windowMain, width=750, height=self.height_window, bg=self.color_contrast)
        self.frameSobrancelhas.pack(side=RIGHT)

        #ATRIBUI AO FRAME ATUAL
        self.frame_only = self.frameSobrancelhas

    def olhos(self):
        #DESTROI O FRAME ATUAL
        self.destruirFrameOnly()

        #FRAME DE EXIBIÇÃO HOME
        self.frameOlhos = Frame(self.windowMain, width=750, height=self.height_window, bg=self.color_contrast)
        self.frameOlhos.pack(side=RIGHT)

        #ATRIBUI AO FRAME ATUAL
        self.frame_only = self.frameOlhos

    def croche(self):
        #DESTROI O FRAME ATUAL
        self.destruirFrameOnly()

        #FRAME DE EXIBIÇÃO HOME
        self.frameCroche = Frame(self.windowMain, width=750, height=self.height_window, bg=self.color_contrast)
        self.frameCroche.pack(side=RIGHT)

        #ATRIBUI AO FRAME ATUAL
        self.frame_only = self.frameCroche

    def servicos(self):
        #DESTROI O FRAME ATUAL
        self.destruirFrameOnly()

        #FRAME DE EXIBIÇÃO HOME
        self.frameServicos = Frame(self.windowMain, width=750, height=self.height_window, bg=self.color_contrast)
        self.frameServicos.pack(side=RIGHT)

        #ATRIBUI AO FRAME ATUAL
        self.frame_only = self.frameServicos

    def ajustes(self):
        #DESTROI O FRAME ATUAL
        self.destruirFrameOnly()

        #FRAME DE EXIBIÇÃO HOME
        self.frameAjustes = Frame(self.windowMain, width=750, height=self.height_window, bg=self.color_contrast)
        self.frameAjustes.pack(side=RIGHT)
        
        lblTitulo = Label(self.frameAjustes, text='AJUSTES', font=self.font_titulo, bg=self.color_contrast)
        lblTitulo.place(x=325, y=10)

        #ATRIBUI AO FRAME ATUAL
        self.frame_only = self.frameAjustes

    def destruirFrameOnly(self):
        #DESTROI A TELA ATUAL CASO EXISTA
        if self.frame_only:
            self.frame_only.destroy()

    def setImagensBase64(self):
        self.imagem_logo = ''
        self.imagem_inicio = ''
        self.imagem_unhas = ''
        self.imagem_sobrancelhas = ''
        self.imagem_croche = ''
        self.imagem_calendario = ''
        self.imagem_config = ''

Tela_Principal()